import React, {ReactElement} from 'react';
import {
    Button, IconButton, Paper, Table, TableBody,
    TableCell, TableContainer, TableRow, TextField
} from "@material-ui/core";
import {Order, Translation} from "../utils/types";
import CustomTableHead from "./CustomTableHead";
import {APP_ID, CONTEXT, DE, EN, FR, IT, STAGE, TEXT_ID} from "../utils/constants";
import DeleteIcon from '@material-ui/icons/Delete';
import '@axa-ch/button'
import '@axa-ch/table-sortable';


export default function TranslationTable() {


        function mapTranslationToTableRow() {
            // @ts-ignore
            return (

                <TableRow key={translation.id} className={"tableRow"}>
                    <TableCell className={"appIdField"}>
                        <TextField name={APP_ID} value={translation.appId}
                                   key={translation.id}
                                   className={"appIdInput"}
                                   label={"App-ID"} required
                                   onChange={e => handleChangeTranslationTable(e, index, APP_ID)}
                        />
                    </TableCell>
                    <TableCell className={"contextField"}>
                        <TextField name={CONTEXT}
                                   value={translation.context}
                                   key={translation.id}
                                   className={"contextInput"}
                                   label={"Kontext"} required
                                   onChange={e => handleChangeTranslationTable(e, index, CONTEXT)}
                        />
                    </TableCell>
                    <TableCell className={"textIdField"}>
                        <TextField name={TEXT_ID}
                                   value={translation.textId}
                                   key={translation.id}
                                   className={"textIdInput"}
                                   label={"Text-ID"} required
                                   onChange={e => handleChangeTranslationTable(e, index, TEXT_ID)}
                        />
                    </TableCell>
                    <TableCell className={"stageField"}>
                        <TextField name={STAGE}
                                   value={translation.stage}
                                   key={translation.id}
                                   className={"stageInput"}
                                   label={"Stage"} required
                                   onChange={e => handleChangeTranslationTable(e, index, STAGE)}
                        />
                    </TableCell>
                    <TableCell className={"deField"}>
                        <TextField name={DE}
                                   value={translation.de}
                                   key={translation.id}
                                   className={"deInput"}
                                   label={"Deutsch"}
                                   onChange={e => handleChangeTranslationTable(e, index, DE)}
                        />
                    </TableCell>

                    <TableCell className={"frField"}>
                        <TextField name={FR}
                                   value={translation.fr}
                                   key={translation.id}
                                   className={"frInput"}
                                   label={"FranzÃ¶sisch"}
                                   onChange={e => handleChangeTranslationTable(e, index, FR)}
                        />
                    </TableCell>
                    <TableCell className={"itField"}>
                        <TextField name={IT}
                                   value={translation.it}
                                   key={translation.id}
                                   className={"itInput"}
                                   label={"Italienisch"}
                                   onChange={e => handleChangeTranslationTable(e, index, IT)}
                        />
                    </TableCell>
                    <TableCell className={"enField"}>
                        <TextField name={EN}
                                   value={translation.en}
                                   key={translation.id}
                                   className={"enInput"}
                                   label={"Englisch"}
                                   onChange={e => handleChangeTranslationTable(e, index, EN)}
                        />
                    </TableCell>
                    <TableCell className={"lastCallField"}>
                        <TextField
                            value={translation.lastCall ? translation.lastCall : '-'}
                            key={translation.id}
                            label={"Aufruf"}
                            className={"lastCallInput"} disabled
                        />
                    </TableCell>
                    <TableCell className={"buttonField"}>
                        {/*<Button variant="contained"*/}
                        {/*        color="primary"*/}
                        {/*        id={"saveButton"}*/}
                        {/*        onClick={() => updateTranslation(translation)}>*/}
                        {/*    Speichern*/}
                        {/*</Button>*/}
                        <axa-button
                            variant="default"
                            id={"saveButton"}
                            onClick={() => updateTranslation(translation)}
                        >
                            speichern
                        </axa-button>
                    </TableCell>
                    <TableCell className={"buttonField"}>
                        <IconButton aria-label="delete"
                                    id={"deleteButton"}
                                    color={"secondary"}
                                    onClick={() => deleteTranslation(translation)}>
                            <DeleteIcon fontSize="default"/>
                        </IconButton>
                    </TableCell>
                </TableRow>
            );
        }


        return (
            <TableContainer component={Paper}>
                <Table>
                    <CustomTableHead
                        handleSort={handleSort}
                        order={order}
                        orderBy={orderBy}
                    />
                    <TableBody>
                        {translations.map((translation, index) => mapTranslationToTableRow(translation, index))}
                    </TableBody>
                </Table>
            </TableContainer>
        );
}
